import styled from "styled-components";
import { motion } from "framer-motion";

const HomeNavbarDown = [
  "About",
  "Contact us",
  "Login",
  "Signup",
  "Forgot Password",
  "Dashboard",
  "Subscription",
];
const Paths = ["/", "home2", "home3"];

const NavbarOtherPages = () => {
  return (
    <NavbarOtherPagesStyle>
      <motion.div
        className="dropDown"
        animate={controller}
        whileHover={{ opacity: 1 }}
      >
        {HomeNavbarDown.map((e, i) => (
          <Link to={Paths[i]} className="dropDownItem" key={i}>
            <motion.spann
              whileHover={{ color: "#f2c14e" }}
              transition={{ duration: 0.1 }}
            >
              {e}
            </motion.spann>
          </Link>
        ))}
      </motion.div>
      );
    </NavbarOtherPagesStyle>
  );
};
export default NavbarOtherPages;
